import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import NavBar from './Components/NavBar.js';
import HeaderContent from './Components/HeaderContent.js';
import MainContent from './Components/MainContent.js';
import Meetups from './Components/Meetups.js';
import Members from './Components/Members.js';
import MainTitle from './Components/MainTitle.js';
import MainTitleSee from './Components/MainTitleSee.js';


class App extends Component {

  constructor(props){
    super(props)
    this.state = {
      title: 'ini sebuah title lewat state',
      menu1: 'Create Meetup',
      menu2: 'Explore',
      asoi: [
        {        
          name: 'Create Meetup'      
        },
        {        
          name: 'Explore'      
        }
      ]    
    }
  }

  render() {
    let { title, menu1, menu2 } = this.state;
    return (
      <React.Fragment>


        <NavBar menu1n={menu1} menu2n={menu2}/>
        <HeaderContent/>
        <MainTitle/>
        <MainContent/>
        <MainTitle/>
        <Meetups/>
        <MainTitleSee/>
        <Members/>
        <MainTitleSee/>

      </React.Fragment>
    );
  }
}

export default App;
